import { useState } from 'react';
import './App.css';

export default function App() {
  const [tarefas, setTarefas] = useState([{tarefa: 'Teste'}])
  return (
    <div>
      <h1>Lista de tarefas</h1>
      <button onClick={()=> setTarefas(tarefas + 1)}>Enviar</button>
      <ul>
        <li>{tarefas.tarefa}</li>
      </ul>
    </div>
  );
}
